import React, { useState, useEffect } from 'react';
import { useRouteMatch } from 'react-router-dom';
import Sidebar from "../../blocks/Sidebar";
import Patient from "../../blocks/Patient";
import {Col, Layout, Row, Space} from "antd";
import Header from "../../blocks/Header";

const PatientPage = () => {
    const rm = useRouteMatch();
    const [patient, setPatient] = useState(null);

    useEffect(() => {
        fetch(`https://my-json-server.typicode.com/3lement3/VH2/patients/${rm.params.id}`)
            .then((r) => r.json())
            .then((r) => setPatient(r));
    }, []);

    return (
        <>
            <Header/>
            <Layout>
                <Sidebar />
                <Layout.Content className="layout-content">
                    { patient &&
                        <>
                            <Row>
                                <Col span={16}>
                                    <Patient data={patient}/>
                                    <Row>
                                        <Col>
                                            <h2>Предстоящие приёмы</h2>
                                            <Space>
                                                <img alt="прием" src='data:image/png;base64,'/>
                                                <img alt="прием" src='data:image/png;base64,'/>
                                                <img alt="прием" src='data:image/png;base64,'/>
                                            </Space>
                                        </Col>
                                    </Row>
                                    <Row>
                                        <Col>
                                            <h2>Активный курс</h2>
                                            <p>План лечения пациента</p>
                                            <img alt="план" src='data:image/png;base64,'/>
                                        </Col>
                                    </Row>
                                    <Row>
                                        <Col>
                                            <h2>Результаты лабораторных анализов</h2>
                                            <img alt="анализы" src='data:image/png;base64,'/>
                                        </Col>
                                    </Row>
                                    <Row>
                                        <Col>
                                            <h2>Отчеты о приёмах</h2>
                                            <img alt="отчеты" src='data:image/png;base64,'/>
                                        </Col>
                                    </Row>
                                </Col>
                                <Col span={6}>
                                    <img className="patient-button" alt="кнопка" src='data:image/png;base64,'/>
                                    <img src='data:image/png;base64,'/>
                                    <img src='data:image/png;base64,'/>
                                    <img src='data:image/png;base64,'/>
                                    <img src='data:image/png;base64,'/>
                                    <img src='data:image/png;base64,'/>
                                </Col>
                            </Row>
                        </>
                    }
                </Layout.Content>
            </Layout>
        </>
    );
};

export default PatientPage;